{
  "openapi": "3.0.0",
  "servers": [
    {
      "url": "https://api.example.com/publicapi/api/v2"
    }
  ],
  "info": {
    "version": "2.0.0",
    "title": "e-Transfer Public API"
  },
  "paths": {
    "/oauth/access-tokens": {
      "parameters": [
        {
          "$ref": "#/components/parameters/thirdPartyAccessId"
        },
        {
          "$ref": "#/components/parameters/requestId"
        }
      ],
      "get": {
        "description": "Get the access token\n",
        "parameters": [
          {
            "name": "grantType",
            "in": "header",
            "required": true,
            "description": "token grant type; 'client_credentials' or 'request_token'\n",
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "grantRequest",
            "in": "header",
            "required": true,
            "description": "for 'client_credentials' use the secret key generated during the partner registration; for 'request_token' use the JWT request token built according to the Public API Integration Guide",
            "schema": {
              "type": "string"
            }
          }
        ],
        "tags": [
          "Authentication"
        ],
        "security": [
          {
            "etransfer_auth": [
              "etransfer.r",
              "etransfer.w"
            ]
          }
        ],
        "responses": {
          "200": {
            "description": "Successful response",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/AccessToken"
                },
                "examples": {
                  "response": {
                    "value": {
                      "accessToken": "4863dc7c-2a00-11e8-b467-0ed5f89f718b",
                      "tokenType": "bearer",
                      "expiresIn": 600,
                      "scope": "etransfer.r etransfer.w"
                    }
                  }
                }
              }
            }
          },
          "400": {
            "description": "Validation Errors",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/errorModel"
                },
                "examples": {
                  "response": {
                    "value": [
                      {
                        "code": 1000,
                        "message": "Invalid request"
                      }
                    ]
                  }
                }
              }
            }
          },
          "401": {
            "description": "Unauthorized",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/errorModel"
                },
                "examples": {
                  "response": {
                    "value": [
                      {
                        "code": 1001,
                        "message": "Invalid access"
                      }
                    ]
                  }
                }
              }
            }
          },
          "default": {
            "description": "unexpected error",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/errorModel"
                },
                "examples": {
                  "response": {
                    "value": [
                      {
                        "code": 9999,
                        "message": "Unknown application error"
                      }
                    ]
                  }
                }
              }
            }
          }
        }
      }
    },
