    "/contacts": {
      "parameters": [
        {
          "$ref": "#/components/parameters/accessToken"
        },
        {
          "$ref": "#/components/parameters/thirdPartyAccessId"
        },
        {
          "$ref": "#/components/parameters/requestId"
        },
        {
          "$ref": "#/components/parameters/deviceId"
        },
        {
          "$ref": "#/components/parameters/applicationId"
        },
        {
          "$ref": "#/components/parameters/apiRegistrationId"
        }
      ],
      "get": {
        "operationId": "getContacts",
        "description": "Retrieves all the contacts",
        "parameters": [
          {
            "name": "maxResponseItems",
            "in": "query",
            "required": false,
            "schema": {
              "type": "integer"
            }
          },
          {
            "name": "fromLastUpdatedDate",
            "in": "query",
            "required": false,
            "description": "UTC datatime of contact used to retrieve only contacts updated from the specified dateTime; format is yyyy-MM-dd'T'HH:mm:ss.SSS'Z', e.g. '2016-09-11T16:12:12.000'",
            "schema": {
              "type": "string",
              "format": "datetime"
            }
          },
          {
            "name": "offset",
            "in": "query",
            "required": false,
            "description": "offset is starting point of contacts filter; if offset is not provided it would be defaulted to zero;",
            "schema": {
              "type": "integer"
            }
          },
          {
            "name": "sortBy",
            "in": "query",
            "required": false,
            "description": "contacts will be sorted based on sortBy column, \n - sortBy will be set to contactUpdatedDate if fromLastUpdatedDate.\n - sortBy will be defaulted to contactName if no filters are specified.",
            "schema": {
              "type": "string",
              "enum": [
                "contactName",
                "contactUpdatedDate"
              ]
            }
          },
          {
            "name": "orderBy",
            "in": "query",
            "required": false,
            "description": "order by is required if sort by is specified.",
            "schema": {
              "type": "string",
              "enum": [
                "desc",
                "asc"
              ]
            }
          }
        ],
        "tags": [
          "Contact management"
        ],
        "responses": {
          "200": {
            "description": "Successful response",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "description": "List of contacts returned for customer",
                  "items": {
                    "$ref": "#/components/schemas/Contact"
                  }
                }
              }
            }
          },
          "206": {
            "description": "Partial content returned, use pagination filters",
            "headers": {
              "x-limit": {
                "description": "contact range returned",
                "schema": {
                  "type": "string"
                }
              },
              "x-total-count": {
                "description": "total number of contacts for provided filter.",
                "schema": {
                  "type": "integer"
                }
              }
            },
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "description": "List of partial contacts returned based on max item",
                  "items": {
                    "$ref": "#/components/schemas/Contact"
                  }
                }
              }
            }
          },
          "400": {
            "description": "Validation Errors",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/errorModel"
                },
                "examples": {
                  "response": {
                    "value": [
                      {
                        "code": 1000,
                        "message": "Invalid request."
                      },
                      {
                        "code": 1011,
                        "message": "Invalid apiRegistartionId."
                      },
                      {
                        "code": 1048,
                        "message": "Hard contact already exist for sender."
                      },
                      {
                        "code": 1053,
                        "message": "orderBy field is missing."
                      }
                    ]
                  }
                }
              }
            }
          },
          "401": {
            "description": "Unauthorized",
