  "components": {
    "parameters": {
      "thirdPartyAccessId": {
        "name": "thirdPartyAccessId",
        "in": "header",
        "description": "unique id that identifies a third party partner",
        "required": true,
        "schema": {
          "type": "string",
          "maximum": 50
        }
      },
      "requestId": {
        "name": "requestId",
        "in": "header",
        "description": "partner generated unique id for each request used for message tracking purposes",
        "required": true,
        "schema": {
          "type": "string",
          "minimum": 1,
          "maximum": 64
        }
      },
      "deviceId": {
        "name": "deviceId",
        "in": "header",
        "description": "user device unique identifier",
        "required": true,
        "schema": {
          "type": "string",
          "minimum": 1,
          "maximum": 64
        }
      },
      "applicationId": {
        "name": "applicationId",
        "in": "header",
        "description": "user application unique identifier",
        "required": false,
        "schema": {
          "type": "string",
          "minimum": 1,
          "maximum": 64
        }
      },
      "accessToken": {
        "name": "accessToken",
        "in": "header",
        "required": true,
        "description": "OAuth2 access token, the format is 'Bearer AccessToken'.\n",
        "schema": {
          "type": "string",
          "maximum": 64
        }
      },
      "apiRegistrationId": {
        "name": "apiRegistrationId",
        "in": "header",
        "description": "unique identifier for the user api registration",
        "required": true,
        "schema": {
          "type": "string",
          "maximum": 50
        }
      },
      "participantAccessToken": {
        "name": "participantAccessToken",
        "in": "header",
        "description": "access token provided by participant.",
        "required": false,
        "schema": {
          "type": "string",
          "maximum": 64
        }
      }
    },
    "requestBodies": {
      "Contact": {
        "content": {
          "application/json": {
            "schema": {
              "$ref": "#/components/schemas/Contact"
            }
          }
        },
        "required": true
      },
      "DeclineReason": {
        "content": {
          "application/json": {
            "schema": {
              "$ref": "#/components/schemas/DeclineReason"
            }
          }
        }
      },
