    "securitySchemes": {
      "etransfer_auth": {
        "type": "oauth2",
        "description": "This API uses OAuth 2 with the client credential grant flow.",
        "flows": {
          "clientCredentials": {
            "tokenUrl": "https://localhost:6882/token",
            "scopes": {
              "etransfer.w": "write permission",
              "etransfer.r": "read permission"
            }
          }
        }
      }
    },
    "schemas": {
      "AccessToken": {
        "type": "object",
        "required": [
          "accessToken",
          "expiresIn"
        ],
        "properties": {
          "accessToken": {
            "type": "string"
          },
          "tokenType": {
            "type": "string",
            "description": "example value is 'bearer'"
          },
          "expiresIn": {
            "type": "integer",
            "description": "how many seconds the token will expire"
          },
          "scope": {
            "type": "string",
            "description": "example value is 'read trust write'"
          }
        }
      },
      "UserRegistration": {
        "type": "object",
        "required": [
          "thirdPartyUserId",
          "allowedFeatures"
        ],
        "properties": {
          "apiRegistrationId": {
            "type": "string",
            "maxLength": 50,
            "description": "unique identifier for the user api registration; not required in POST request"
          },
          "participantId": {
            "type": "string",
            "minLength": 8,
            "maxLength": 8,
            "description": "participant id in e-Transfer system; required if api registration is created through the public api and directDepositRegistration is not specified."
          },
          "indirectConnectorId": {
            "type": "string",
            "minLength": 9,
            "maxLength": 9,
            "description": "indirect connector id in e-Transfer system"
          },
          "participantUserId": {
            "type": "string",
            "minLength": 1,
            "maxLength": 32,
            "description": "participant defined user id in e-Transfer system; required if api registration is created through the public api and directDepositRegistration is not specified."
          },
          "participantApiRegistrationId": {
            "type": "string",
            "minLength": 1,
            "maxLength": 32,
            "description": "participant defined identifier for this Api registration; required if api registration is created through the public api"
          },
          "fiAccountId": {
            "type": "string",
            "minLength": 1,
            "maxLength": 50,
            "description": "unique identifier set by financial institution corresponding to the user's bank account; required if api registration is created through the public api and directDepositRegistration is not specified."
          },
          "registrationStatus": {
            "type": "string",
            "enum": [
              "pending",
              "active",
              "inactive",
              "failed",
              "in-review"
            ],
            "description": "status of the user registration request 'pending','active','inactive','failed','in-review'"
          },
          "allowedFeatures": {
            "type": "array",
            "items": {
              "type": "string",
              "enum": [
                "contact_mgmnt",
                "money_request_mgmt",
                "transfer_mgmt",
                "send_money_requests",
                "fulfill_money_requests",
                "send_transfers",
                "receive_transfers",
                "user_registration_mgmnt",
                "contact_mgmnt_ext_api",
                "money_request_mgmt_ext_api",
                "transfer_mgmt_ext_api"
              ],
              "description": "functionality allowed to be used through this API; 'contact_mgmnt', 'send_money_requests', 'fulfill_money_requests', 'send_transfers', 'receive_transfers', 'user_registration_mgmnt' The below feature's are only for external app's, which doesn't need to be synchronized with online banking transfers, contacts and money requests  'contact_mgmnt_ext_api', 'money_request_mgmt_ext_api,'transfer_mgmt_ext_api'"
            }
          },
          "thirdPartyUserId": {
            "type": "string",
            "minLength": 1,
            "maxLength": 50,
            "description": "unique third party partner defined user id in e-Transfer system"
          },
          "directDepositRegistration": {
            "$ref": "#/components/schemas/DirectDepositRegistration"
          },
          "customerDetails": {
            "$ref": "#/components/schemas/CustomerDetails"
          },
          "name": {
            "type": "string",
            "minLength": 1,
            "maxLength": 64
          },
          "logoUrl": {
            "type": "string",
            "minLength": 1,
            "maxLength": 200
          },
          "websiteUrl": {
            "type": "string",
            "minLength": 1,
            "maxLength": 64
          }
        }
      },
      "UserRegistrationUpdate": {
        "type": "object",
        "properties": {
          "allowedFeatures": {
            "type": "array",
            "items": {
              "type": "string",
              "enum": [
                "contact_mgmnt",
                "money_request_mgmt",
                "transfer_mgmt",
                "send_money_requests",
                "fulfill_money_requests",
                "send_transfers",
                "receive_transfers",
                "user_registration_mgmnt",
                "contact_mgmnt_ext_api",
                "money_request_mgmt_ext_api",
                "transfer_mgmt_ext_api"
